	add("robert", "{\"term\":\"robert\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027robert\u0027 () from the Old Frankish cognate of Old High German \u0027hrodperht\u0027 () (normalised form: \u0027ruodberht\u0027 () , from Proto-germanic {{m|gem-pro|*hrōþiz||fame}} + Proto-germanic {{m|gem-pro|*berhtaz||bright, shining}}.\u0026lt;!-- \u0026lt;ref\u0026gt;{{R:VDSchaar|year\u003d1994|hw\u003dRobrecht}}\u0026lt;/ref\u0026gt; --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Act I, Scene I\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"My brother \u0027\u0027Robert\u0027\u0027? Old Sir \u0027\u0027Robert\u0027\u0027s son? / Colbrand the giant, that same mighty man\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027 w:John Edgar John Edgar Wideman, \u0027Brothers and Keepers: A Memoir\u0027, Mariner Books, 2005, ISBN 0618509631, page 9\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I hadn\u0027t even considered names for a girl. Robby it would be. \u0027\u0027Robert\u0027\u0027 Douglas. Where the Douglas came from is another story, but the \u0027\u0027Robert\u0027\u0027 came from me because I liked the sound. \u0027\u0027Robert\u0027\u0027 was formal, dignified, important. \u0027\u0027Robert\u0027\u0027. And that was nearly as nice as as the chance I\u0027d have to call my little brother Rob and Robby\", \"priority\":4}]}, \"synonyms\":{}}");

