	add("robin", "{\"term\":\"robin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From the proper name Robin, Old french (842-ca. 1400) diminutive of Robert.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Various passerine birds (about 100 species) of the families Muscicapidae, Turdidae and Petroicidae (formerly \u0027\u0027), typically with a red breast\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A European robin; \u0027Erithacus rubecula\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1519647W “Piracy”: A Romantic Chronicle of These chapter\u003dEp./4/2|passage\u003dAs they turned into Hertford Street they startled a \u0027\u0027robin\u0027\u0027 from the poet\u0027s head on a barren fountain, and he fled away with a cameo note\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An American robin; \u0027Turdus migratorius\", \"priority\":4}]}, \"synonyms\":{}}");

	add("robin", "{\"term\":\"robin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) diminutive of \u0027robert\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"late 1300s\u0027\u0027, Geoffrey Chaucer, \u0027The Canterbury Tales\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Oure Hoste saugh that he was dronke of ale\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And seyde, \u0026quot;Abyd, \u0027\u0027Robin,\u0027\u0027 my leve brother\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Som bettre man shal telle us first another\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Abyd, and lat us werken thriftily.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Scene 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"They say he is already in the forest of Arden, and a many merry men with him; and there they live like the old \u0027\u0027Robin\u0027\u0027 Hood of England\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1785\u0027\u0027, w:Robert Robert Burns, \u0027Rantin\u0027, Rovin\u0027 Robin\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"This waly boy will be nae coof: /I think we\u0027ll call him \u0027\u0027Robin\u0027\u0027./ \u0027\u0027Robin\u0027\u0027 was a rovin\u0027 boy, / Rantin\u0027, rovin\u0027, rantin\u0027, rovin\u0027, /\u0027\u0027Robin\u0027\u0027 was a rovin\u0027 boy, / Rantin\u0027, rovin\u0027 \u0027\u0027Robin\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, w:Julian Julian Barnes, \u0027Talking It Over\u0027, Jonathan Cape (ISBN 0224031570), page 12\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Some names simply aren\u0027t appropriate after a while. Say you were called \u0027\u0027Robin\u0027\u0027, for instance. Well that\u0027s a perfectly good monicker up to the age of about nine, but pretty soon you\u0027d have to do something about it, wouldn\u0027t you? Change your name by deed-poll to Samson, or Goliath, or something\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"also associated with the bird robin\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, w:Adela Rogers St. Adela Rogers St. John, \u0027Never Again, and Other Stories\u0027 (Doubleday 1949), page 25\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"quot;We\u0027ll name her \u0027\u0027Robin\u0027\u0027,\u0026quot; her mother said, and and it was as though at her words something of that spring and the bird\u0027s song and his gay and friendly and impudent spirit entered into the child\", \"priority\":14}]}, \"synonyms\":{}}");

	add("robot", "{\"term\":\"robot\", \"etymology\":{\"influencers\":[], \"languages\":[\"Czech\", \"English\"], \"text\":\"From Czech {{m|cs|robot}}, from {{m|cs|robota||drudgery, servitude}}. Coined in the 1921 science-fiction play \u0027W:R.U.R. (Rossum\u0027s Universal Robots)|R.U.R. (Rossum\u0027s Universal Robots)\u0027 by {{w|Karel Čapek}} after having been suggested to him by his brother Josef [http://ui.fpf.slu.cz/persons/Kelemen/articles/HorKelALIFEIXDef.pdf], and taken into the English translation without change.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A machine built to carry out some complex task or group of tasks, especially one which can be programmed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Tim Webb, \u0027The Guardian\u0027, 16 May 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s painfully slow and complex work which has never been attempted before in these conditions: the small box-shaped \u0027\u0027robots\u0027\u0027, equipped with two claws, are operating in almost freezing water 5,000ft below the surface, in pitch black and strong currents\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An intelligent mechanical being designed to look like a human or other creature, and usually made from metal\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Tom Chivers and Iain McDiarmid, \u0027The Telegraph\u0027, 26 Jan 2010\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027robots\u0027\u0027 in Dick\u0027s novel, loosely adapted by Ridley Scott into the film Blade Runner, were so similar to humans that when they went rogue, trained bounty hunters were called in to perform psychological tests to see whether suspected androids lacked human empathy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A person who does not seem to have any emotions\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Murray N. Rothbard, \u0027Making Economic Sense\u0027 (page xiv\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Yet surely he was a humorless \u0027\u0027robot\u0027\u0027 of a man, spewing forth lonely and bitter critiques of all those lesser mortals with whom he could not identify\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A traffic light (from earlier \u0027robot policeman\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A theodolite which follows the movements of a prism and can be used by a one-man crew\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A style of dance popular in disco whereby the dancer impersonates the movement of a robot\", \"priority\":12}]}, \"synonyms\":{}}");

